import React from "react";
import { Route, Link, BrowserRouter as Router } from 'react-router-dom';

function HorizontalnaLista(props) {

  return (
    <Router>
      <ul>
        <li><Link to={props.prviLink}>{props.prvi}</Link></li>
        <li><Link to={props.drugiLink}>{props.drugi}</Link></li>
        <li><Link to={props.treciLink}>{props.treci}</Link></li>
        <li><Link to={props.cetvrtiLink}>{props.cetvrti}</Link></li>
      </ul>
    </Router>

  );
}

export default HorizontalnaLista;
